import React from "react";
import PropTypes from "prop-types";
import { Hero } from "../../ui-components";
import { Box, Typography } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

function Home(props) {
  const useStyles = makeStyles((theme) => ({
    darkSection: {
      backgroundColor: theme.palette.primary.dark,
      height: "100%",
      minHeight: "100vh",
      zIndex: "-1",
      position: "absolute",
      top: 0,
      left: 0,
      right: 0,
      padding: "4%",
      maxWidth: "100%",
      margin: "24rem auto",
    },
  }));
  const classes = useStyles();
  return (
    <>
      <Hero />
      <Box classes={classes.darkSection}>
        <Box>
          <Typography>
            We believe being healthy and having fun can go hand in hand. Which
            is why we created a space for everyone to enjoy our house-fermented,
            crystal-clear hard seltzer together. It's like a brewery but for
            seltzer. A seltzery.
          </Typography>
        </Box>
        <Box></Box>
      </Box>
    </>
  );
}

Home.propTypes = {};

export default Home;
